import React from "react";
import { BrowserRouter as Router, Route, Redirect } from "react-router-dom";
import Users from "./user/pages/Users";
import NewPost from "./posts/pages/NewPost";

const App = () => {
  return (
    <Router>
      <Route path="/" exact>
        <Users />
      </Route>
      <Route path="/posts/new" exact>
        <NewPost />
      </Route>
      <Redirect to="/" />
    </Router>
  );
};

export default App;
